import Unit from "../unit/Unit";
import IStrategy from "../../interface/IConcreteStrategy";
export default class MageStrategy implements IStrategy {
  public doAlgorithm(position: number): void {
    console.log("Mage strategy", position);
  }
  public doTargetSelection(unit: Unit,battleField): Array<Unit> {
    console.log(" Mage target selection");
    console.log(unit);
    console.log("unit in queue");
    const units = [unit, unit];
    return units;

}
}
